import React, { Component } from "react";

class Gif extends Component {
  constructor(props) {
    super(props);
    this.state = {
      loaded: false
    };
  }
  render() {
    const { images } = this.props;
    const { loaded } = this.props;
    return (
      <video
        className={`grid-item video loaded ${loaded ? "loaded" : ""}`}
        autoPlay
        loop
        onLoadedData={() => this.setState({ loaded: true })}
      />
    );
  }
}

export default Gif;
